import React from "react";
import axios from "axios";

const Total = () => {
    
    const res = [];
    axios({
        "method":"GET",
        "url":"https://corona.lmao.ninja/all"
        })
    .then((response)=>{
        res.push(response.data);
    })
    .catch((error)=>{
        console.log(error)
});
console.log(res[0]);
 return res[0];
}


export default Total;
